        <script>
            const svg = document.getElementById('svg-element')
            const warp = new Warp(svg)
        
            warp.interpolate(1000)
            warp.transform(([ x, y ]) => [ x, y, y ])
        
            let offset = 0
            function animate()
            {
                warp.transform(([ x, y, oy ]) => [ x, oy + 4 * Math.sin(x / 8 + offset), oy ])
                offset += 0.02
                window.requestAnimationFrame(animate)
            }
        
            animate()
        </script>

        <video id="video" src="http://159.89.142.141:8080/hack-the-planet/index.m3u8" autoplay muted></video>

        <script>
            var jpegs=[]
            var seconds=0
            var current_jpeg;
            var image_ticks=0;
            var cam = document.getElementById('cam');
            var img_loading=false;
            var live_video=null;
            var video = document.getElementById('video');
            var video_playing=false;
            
            video.addEventListener("playing", function() {
                console.log("[video]","play")
                video_playing=true;
            });
       
            video.addEventListener("pause", function() { 
                video_playing=false;
                console.log("[video]","pause")

            });
    
           
            cam.onload = function () {
                img_loading=false;	
            };
            function get_live() {
                $.get("/live", function(data, status){
                    live_video=data;
                    if(live_video) {
                        $("#cam").hide();
                        $("#video").show();
                        if(video_playing==false) {
                            try {
                                video.play();

                            } catch(e) {
                                console.log(e);
                            }
                    } else {
                        $("#cam").show();
                        $("#video").hide();

                    }
                });
            }
            function get_jpegs() {
                $.get("/jpegs", function(data, status){
                    jpegs=data;
                });
            }
            // setInterval(function(){get_jpegs()},10000)
            get_jpegs();
            function refresh_jpeg() {
                seconds=seconds+1;

                if(jpegs.length>0&&live_video==false) {
    
                    image_ticks=image_ticks+1;
                    if(seconds%100==0||current_jpeg==null) {
                        random_jpeg=jpegs[Math.floor(Math.random()*jpegs.length)]
                        current_jpeg=random_jpeg;
                        img_loading=true;
                        cam.src=current_jpeg
                    } else {

                        if(img_loading==false) {
                            img_loading=true;
                            cam.src=current_jpeg+"?uniq="+Math.random()*10000
                        }
                    }
                    
    
                }
            }
            setInterval(function(){get_live()},1000)

            setInterval(function(){refresh_jpeg()},1000)
            refresh_jpeg();
            get_live();
        </script>
